INSERT INTO "public"."payment_instructions" ("id", "title", "description", "created_at", "updated_at", "step_order", "payment_channel_id") VALUES
(1, 'Pembayaran melalui ATM Mandiri', '<ol><li>Catat kode pembayaran yang anda dapat.</li><li>Gunakan ATM Mandiri untuk menyelesaikan pembayaran.</li><li>Masukkan PIN anda.</li><li>Pilih ''''BAYAR/BELI''''.</li><li>Pilih LAINNYA.</li><li>Cari pilihan MULTI PAYMENT.</li><li>Masukkan kode perusahaan 88558.</li><li>Masukkan kode VIRTUAL ACCOUNT.</li><li>Masukkan atau Pastikan Jumlah Pembayaran sesuai dengan Jumlah Tagihan anda kemudian tekan ''''Benar''''.</li><li>Pilih Tagihan Anda jika sudah sesuai tekan YA.</li><li>Konfirmasikan tagihan anda apakah sudah sesuai lalu tekan YA.</li><li>Harap Simpan Struk Transaksi yang anda dapatkan.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:26:29.32147+00', 2, 3),
(2, 'Pembayaran dengan Livin by Mandiri', '<ol><li>Login Mandiri Online dengan memasukkan USERNAME dan PASSWORD.</li><li>Pilih menu PEMBAYARAN.</li><li>Pilih menu MULTI PAYMENT.</li><li>Cari Penyedia Jasa ''''Media Indonusa''''.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT dan cek nominal yang akan dibayarkan, lalu pilih Lanjut.</li><li>Setelah muncul tagihan, pilih KONFIRMASI.</li><li>Masukkan PIN/ CHALLENGE CODE TOKEN.</li><li>Transaksi selesai, simpan bukti bayar anda.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:26:29.212318+00', 1, 3),
(3, 'Pembayaran Melalui ATM BNI', '<ol><li>Masukkan Kartu Anda.</li><li>Pilih BAHASA.</li><li>Masukkan PIN ATM Anda.</li><li>Pilih ''''MENU LAINNYA''''.</li><li>Pilih ''''TRANSFER''''.</li><li>Pilih JENIS REKENING yang akan Anda gunakan (Contoh; ''''Dari Rekening Tabungan'''').</li><li>Pilih ''''VIRTUAL ACCOUNT BILLING''''.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT Anda.</li><li>Tagihan yang harus dibayarkan akan muncul pada LAYAR KONFIRMASI.</li><li>Konfirmasi, apabila telah sesuai, LANJUTKAN TRANSAKSI.</li><li>Transaksi Anda telah selesai.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:29:27.337503+00', 2, 1),
(4, 'Pembayaran Melalui mBanking BNI', '<ol><li>Akses BNI Mobile Banking dari handphone kemudian masukkan USER ID dan PASSWORD.</li><li>Pilih menu "TRANSFER".</li><li>Pilih menu "VIRTUAL ACCOUNT BILLING" kemudian pilih rekening debet.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT Anda pada menu "INPUT BARU".</li><li>Tagihan yang harus dibayarkan akan muncul pada LAYAR KONFIRMASI.</li><li>Konfirmasi transaksi dan masukkan PASSWORD TRANSAKSI.</li><li>Pembayaran Anda Telah Berhasil.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:29:27.246304+00', 1, 1),
(5, 'Pembayaran Melalui ATM BRI', '<ol><li>Nasabah melakukan pembayaran melalui ATM Bank BRI.</li><li>Pilih Menu Transaksi Lain.</li><li>Pilih Menu Pembayaran.</li><li>Pilih Menu Lainnya.</li><li>Pilih Menu BRIVA.</li><li>Masukan 16 digit Nomor Virtual Account.</li><li>Proses Pembayaran (Ya/Tidak).</li><li>Harap Simpan Struk Transaksi yang anda dapatkan.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:32.692855+00', 3, 2),
(6, 'Pembayaran Melalui Mobile Banking BRI', '<ol><li>Nasabah melakukan pembayaran melalui Mobile/SMS Banking BRI.</li><li>Nasabah memilih Menu Pembayaran melalui Menu Mobile/SMS Banking BRI.</li><li>Nasabah memilih Menu BRIVA.</li><li>Masukan 16 digit Nomor Virtual Account.</li><li>Masukan Jumlah Pembayaran sesuai Tagihan.</li><li>Masukan PIN Mobile/SMS Banking BRI.</li><li>Nasabah mendapat Notifikasi Pembayaran.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:32.569245+00', 1, 2),
(7, 'Pembayaran Melalui Internet Banking BRI', '<ol><li>Nasabah melakukan pembayaran melalui Internet Banking BRI.</li><li>Nasabah memilih Menu Pembayaran.</li><li>Nasabah memilih Menu BRIVA.</li><li>Masukan Kode Bayar dengan 16 digit Nomor Virtual Account.</li><li>Masukan Password Internet Banking BRI.</li><li>Masukan mToken Internet Banking BRI.</li><li>Nasabah mendapat Notifikasi Pembayaran.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:32.638581+00', 2, 2),
(8, 'Pembayaran VA melalui ATM BSI', '<ol><li>Masukkan Kartu Anda.</li><li>Pilih bahasa.</li><li>Masukkan PIN ATM Anda.</li><li>Select MENU LAINNYA.</li><li>Pilih TRANSFER.</li><li>Pilih JENIS REKENING yang akan Anda gunakan.</li><li>Pilih PENAGIHAN AKUN VIRTUAL.</li><li>Masukkan NOMOR REKENING VIRTUAL Anda.</li><li>Tagihan yang harus dibayar akan muncul di LAYAR KONFIRMASI.</li><li>Konfirmasi, jika itu sesuai, LANJUTKAN TRANSAKSI.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:25:51.20286+00', 2, 4),
(9, 'Pembayaran VA melalui mBanking BSI', '<ol><li>Akses BSI Mobile Banking dari ponsel Anda lalu masukkan USER ID dan Password Anda.</li><li>Pilih menu BAYAR, Pilih Institusi.</li><li>Pada isian ID Institusi Pilih FASPAY.</li><li>Masukkan NOMOR REKENING VIRTUAL Anda pada menu ''''Input Baru'''' lalu masukan PIN.</li><li>Tagihan yang harus dibayar akan muncul di LAYAR KONFIRMASI.</li><li>Konfirmasi transaksi.</li><li>Pembayaran Anda Telah Berhasil.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:25:51.295892+00', 3, 4),
(10, 'Pembayaran VA melalui ATM CIMB NIAGA', '<ol><li>Masukan kartu ATM dan PIN CIMB Niaga Anda.</li><li>Pilih Menu Pembayaran.</li><li>Pilih Virtual Account.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT.</li><li>Muncul nama dan nominal billing di layar konfirmasi.</li><li>Pilih OK untuk payment.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:26:40.182953+00', 2, 5),
(11, 'Pembayaran VA melalui OCTO MOBILE', '<ol><li>Login ke Octo Mobile.</li><li>Pilih menu TRANSFER > Transfer to Other CIMB Niaga Account.</li><li>Pilih rekening sumber anda: CASA atau Rekening Ponsel.</li><li>Masukkan nomor Virtual Account Anda pada kolom Transfer To.</li><li>Masukkan jumlah amount sesuai tagihan.</li><li>Ikuti instruksi untuk menyelesaikan transaksi.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:26:40.065701+00', 1, 5),
(12, 'Pembayaran VA melalui ATM Danamon (Closed Payment)', '<ol><li>Masukkan KARTU.</li><li>Pilih BAHASA yang akan digunakan.</li><li>Masukkan PIN, pilih LANJUTKAN.</li><li>Pada menu PILIH JUMLAH UANG ATAU JENIS TRANSAKSI, pilih PEMBAYARAN.</li><li>Pada menu PEMBAYARAN, pilih LAINNYA.</li><li>Pada menu PEMBAYARAN LANJUTAN, pilih VIRTUAL ACCOUNT.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT yang akan dibayarkan, setelah itu pilih BENAR.</li><li>Setelah muncul konfirmasi data pembayaran, pastikan data yang tertera sudah benar. Pilih YA untuk membayar.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:07.882995+00', 2, 6),
(13, 'Pembayaran VA melalui Danamon Mobile Banking D-Bank', '<ol><li>Masukkan USER ID & PASSWORD, pilih LOGIN.</li><li>Pilih PEMBAYARAN.</li><li>Gulung layar kebawah, pilih VIRTUAL ACCOUNT.</li><li>Jika NOMOR VA BELUM PERNAH disimpan, pilih +TAMBAH BILLER BARU untuk memasukkan NOMOR VA.</li><li>Pastikan kebenaran data yang tertera pada layar. Masukkan mPIN untuk mengkonfirmasi pembayaran, pilih KONFIRMASI.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:07.606522+00', 1, 6),
(14, 'Pembayaran VA ATM Maybank', '<ol><li>Masukkan PIN ATM Anda.</li><li>Pilih Transfer.</li><li>Pilih Virtual Account.</li><li>Masukkan Nomor Virtual Account Yang Tertera Pada Halaman Konfirmasi.</li><li>Pilih BENAR.</li><li>Pilih YA.</li><li>Selesai.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:26:51.702987+00', 2, 7),
(15, 'Pembayaran VA Melalui Aplikasi M2U', '<ol><li>Login Aplikasi M2U Menggunakan Fingerprint Atau Masukkan Password.</li><li>Pilih Transfer.</li><li>Pilih Virtual Account.</li><li>Pilih Sumber Tabungan.</li><li>Masukkan Nomor Virtual Account Yang Tertera Pada Halaman Konfirmasi, Klik LANJUT.</li><li>Masukkan Jumlah Transfer, Klik PROSES.</li><li>Klik KONFIRMASI & MINTA TAC.</li><li>Masukkan SMS Token/TAC, Klik OK.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:26:51.594741+00', 1, 7),
(16, 'Pembayaran Melalui ATM Permata', '<ol><li>Masukkan PIN.</li><li>Pilih menu TRANSAKSI LAINNYA.</li><li>Pilih menu PEMBAYARAN.</li><li>Pilih menu PEMBAYARAN LAINNYA.</li><li>Pilih VIRTUAL ACCOUNT.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT.</li><li>Jumlah yang harus dibayar dan nomor rekening akan muncul pada halaman konfirmasi pembayaran. Jika informasi sudah benar, pilih BENAR.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:29:05.108808+00', 2, 8),
(17, 'Pembayaran Melalui Permata Mobile', '<ol><li>Buka aplikasi PERMATAMOBILE.</li><li>Masukkan USER ID & PASSWORD.</li><li>Pilih BAYAR TAGIHAN.</li><li>Pilih VIRTUAL ACCOUNT.</li><li>Masukkan NOMOR VIRTUAL ACCOUNT.</li><li>Pilih REKENING.</li><li>Masukkan NOMINAL PEMBAYARAN.</li><li>Muncul konfirmasi pembayaran.</li><li>Masukkan OTENTIKASI TRANSAKSI (TOKEN).</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:29:04.808485+00', 1, 8),
(18, 'Pembayaran Melalui Menu Pembayaran pada Mesin ATM', '<ol><li>Pilih Pembayaran.</li><li>Pilih Layar Berikutnya.</li><li>Pilih Virtual Account.</li><li>Masukkan kode Virtual Account + No. Pelanggan.</li><li>Tagihan akan muncul secara otomatis atau masukkan jumlah nominal yang akan dibayarkan.</li><li>Pastikan nama penerima dan jumlah sesuai dengan yang akan dibayarkan.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:00.764213+00', 2, 9),
(19, 'Pembayaran Melalui Menu Transfer pada Internet Banking', '<ol><li>Pilih Transfer Dana.</li><li>Pilih Transfer Bank Sinarmas.</li><li>Masukkan kode Virtual Account + No. Pelanggan.</li><li>Tagihan akan muncul secara otomatis atau masukkan jumlah nominal yang akan dibayarkan.</li><li>Pastikan nama penerima dan jumlah sesuai dengan yang akan dibayarkan.</li><li>Silahkan masukkan Nomor Token atau SMS Token Anda.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-16 01:27:00.656867+00', 1, 9),
(20, 'Pembayaran melalui OVO', '<ol><li>Anda akan diarahkan ke aplikasi OVO.</li><li>Jika tidak, buka aplikasi OVO Anda dan cek notifikasi pembayaran yang masuk.</li><li>Pastikan detail transaksi sudah benar.</li><li>Klik Bayar untuk menyelesaikan transaksi.</li><li>Masukkan Security Code OVO Anda.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-15 20:42:51.371794+00', NULL, 11),
(21, 'Pembayaran melalui Alfamart', '<ol><li>Kunjungi gerai Alfamart, Alfamidi, atau Lawson terdekat.</li><li>Sampaikan kepada kasir bahwa Anda ingin melakukan pembayaran untuk merchant Faspay.</li><li>Berikan kode pembayaran yang tertera di layar Anda kepada kasir.</li><li>Lakukan pembayaran sejumlah yang diinformasikan oleh kasir.</li><li>Simpan struk sebagai bukti pembayaran yang sah.</li></ol>', '2025-07-15 20:42:51.371794+00', '2025-07-15 20:42:51.371794+00', NULL, 14),
(22, 'Pembayaran melalui BYOND BSI', '<br><ol><li>Akses BYOND BSI Mobile Banking dari ponsel Anda lalu masukkan&nbsp; Password Anda.</li><li>Pilih menu BAYAR, Pilih&nbsp;Lembaga</li><li>Pilih Faspay</li><li>Masukkan NOMOR REKENING VIRTUAL Anda&nbsp; (16 digit)&nbsp;</li><li>Tagihan yang harus dibayar akan muncul di LAYAR KONFIRMASI.</li><li>Konfirmasi transaksi, masukkan PIN</li><li>Pembayaran Anda Telah Berhasil.<br></li></ol>', '2025-07-15 20:47:49.104603+00', '2025-07-16 03:53:07.571533+00', 1, 4),
(23, 'Pembayaran dengan Mobile Banking', '<ol><li><span style="color: rgb(2, 8, 23);">Login ke aplikasi Mobile Banking atau situs Internet Banking Anda.</span></li><li>Pilih menu <b style="color: rgb(2, 8, 23);">"TRANSFER"</b><span style="color: rgb(2, 8, 23);">, lalu pilih </span><b style="color: rgb(2, 8, 23);">"TRANSFER KE BANK LAIN"</b><span style="color: rgb(2, 8, 23);"> atau </span><b style="color: rgb(2, 8, 23);">"TRANSFER ONLINE ANTARBANK"</b><span style="color: rgb(2, 8, 23);">.</span></li><li>Pilih <b style="color: rgb(2, 8, 23);">"Bank Muamalat"</b><span style="color: rgb(2, 8, 23);"> sebagai bank tujuan.</span></li><li>Masukkan nomor rekening tujuan: <b style="color: rgb(2, 8, 23);">1080011701</b><span style="color: rgb(2, 8, 23);">.</span></li><li>Masukkan jumlah transfer <b style="color: rgb(2, 8, 23);">TEPAT</b><span style="color: rgb(2, 8, 23);"> sesuai nominal tagihan + kode unik (contoh: Rp 100.234).</span></li><li>Pastikan nama penerima yang muncul adalah <b style="color: rgb(2, 8, 23);">Indonesia Juara Yys</b><span style="color: rgb(2, 8, 23);"> dan nominal transfer sudah benar.</span></li><li>Ikuti instruksi selanjutnya untuk menyelesaikan transaksi (biasanya memasukkan PIN atau m-Token).</li><li>Simpan bukti transfer digital (screenshot atau e-receipt) sebagai bukti pembayaran.</li></ol>', '2025-07-21 05:45:26.111116+00', '2025-07-21 05:45:26.111116+00', 1, 16),
(24, 'Pembayaran di ATM bank lain', '<ol><li><span style="color: rgb(2, 8, 23);">Masukkan kartu ATM dan PIN Anda.</span></li><li>Pilih menu <b style="color: rgb(2, 8, 23);">"TRANSFER"</b><span style="color: rgb(2, 8, 23);">.</span></li><li>Pilih <b style="color: rgb(2, 8, 23);">"KE REKENING BANK LAIN"</b><span style="color: rgb(2, 8, 23);">.</span></li><li>Masukkan kode Bank Muamalat: <b style="color: rgb(2, 8, 23);">147</b><span style="color: rgb(2, 8, 23);">.</span></li><li>Masukkan nomor rekening tujuan: <b style="color: rgb(2, 8, 23);">1080011701</b><span style="color: rgb(2, 8, 23);">.</span></li><li>Masukkan jumlah transfer <b style="color: rgb(2, 8, 23);">TEPAT</b><span style="color: rgb(2, 8, 23);"> sesuai nominal tagihan + kode unik (contoh: Rp 100.234). </span><b style="color: rgb(2, 8, 23);">Jangan dibulatkan.</b></li><li>Periksa kembali rincian transaksi pada layar konfirmasi. Pastikan nama penerima adalah <b style="color: rgb(2, 8, 23);">Indonesia Juara Yys</b><span style="color: rgb(2, 8, 23);"> dan nominalnya sudah benar.</span></li><li>Jika sudah benar, lanjutkan transaksi.</li><li>Simpan struk sebagai bukti pembayaran yang sah.</li></ol>', '2025-07-21 05:46:45.772831+00', '2025-07-21 05:46:52.429899+00', 2, 16),
